import React from 'react';
import PropTypes from 'prop-types';
import Easy from '../gamelevels/easy';
const EventHandler = children => {
    return (
        <button>
            onClick={(event) => {
                Easy()
            }}
        </button>
    );
};


EventHandler.propTypes = {};
EventHandler.defaultProps = {};

export default EventHandler;
